import React, { Component } from "react";
import banner from "../header.jpg";

export default class Landing extends Component {
  render() {
    return (
      <div className="header">
        <img src={banner} className="landing_image" alt="" />
        <div className="bar">
          <h1 className="header_name">Cesar Ferreyra-Mansilla</h1>
        </div>

        <div className="introduction">
          <h2 className="hey">Hey!</h2>
          <h2>My name is Cesar Ferreyra-Mansilla.</h2>

          <div className="i_am"></div>
          <h2>Im a</h2>
          <select className="i_am_selector">
            <option>Web Developer</option>
            <option>Writer</option>
          </select>
        </div>
      </div>
    );
  }
}
